-- ----------------------------
-- View structure for get_purchases_list
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[get_purchases_list]') AND type IN ('V'))
	DROP VIEW [dbo].[get_purchases_list]
GO

CREATE VIEW [dbo].[get_purchases_list] AS SELECT CONVERT(VARCHAR,transDate,111) as [Date],
purchaseRequisitionNo as [No],
cardId as CustomerID,
cardName as Customer,
CONVERT(varchar, CAST(totalAmount AS money), 1) as TotalAmount,
Type
FROM(SELECT
dbo.tblPurchaseRequisition.transDate,
dbo.tblPurchaseRequisition.purchaseRequisitionNo,
dbo.tblCardsProfile.cardID,
dbo.tblCardsProfile.cardName,
dbo.tblPurchaseRequisition.totalAmount,
'Purchase Requisition' as Type
FROM
dbo.tblPurchaseRequisition
INNER JOIN dbo.tblCardsProfile ON dbo.tblPurchaseRequisition.cardID = dbo.tblCardsProfile.cardID
union all
SELECT
dbo.tblPurchaseOrder.transDate,
dbo.tblPurchaseOrder.purchaseOrderNo,
dbo.tblCardsProfile.cardID,
dbo.tblCardsProfile.cardName,
dbo.tblPurchaseOrder.totalAmount,
'Purchase Order' as Type
FROM
dbo.tblPurchaseOrder
INNER JOIN dbo.tblCardsProfile ON dbo.tblCardsProfile.cardID = dbo.tblPurchaseOrder.cardID
union all
SELECT
dbo.tblPurchaseInvoice.transDate,
dbo.tblPurchaseInvoice.purchaseInvoiceNo,
dbo.tblCardsProfile.cardID,
dbo.tblCardsProfile.cardName,
dbo.tblPurchaseInvoice.totalAmount,
'Purchase Invoice' as Type
FROM
dbo.tblPurchaseInvoice
INNER JOIN dbo.tblCardsProfile ON dbo.tblPurchaseInvoice.cardID = dbo.tblCardsProfile.cardID) AS SUBT
GO


