INNER JOIN dbo.tblCardsProfile ON dbo.tblQuotation.cardID = dbo.tblCardsProfile.cardID
union all
SELECT
dbo.tblSalesOrder.transDate,
dbo.tblSalesOrder.salesOrderNo,
dbo.tblCardsProfile.cardID,
dbo.tblCardsProfile.cardName,
dbo.tblSalesOrder.totalAmount,
'Sales Order' as Type
FROM
dbo.tblSalesOrder
INNER JOIN dbo.tblCardsProfile ON dbo.tblCardsProfile.cardID = dbo.tblSalesOrder.cardID
union all
SELECT
dbo.tblSalesInvoice.transDate,
dbo.tblSalesInvoice.salesInvoiceNo,
dbo.tblCardsProfile.cardID,
