	DROP VIEW [dbo].[paymentsView]
GO

CREATE VIEW [dbo].[paymentsView] AS SELECT CARDID,
CARDNAME,
INVOICENO,
CASE WHEN sum(TOTALAMOUNT)- sum(AMOUNTPAID) <= 0 then 'CLOSE' ELSE 'OPEN' END AS STATUS,
[DATE],
SUM(TOTALAMOUNT) AS TOTALAMOUNT,
SUM(AMOUNTPAID) AS AMOUNTPAID
FROM(
SELECT
dbo.tblCardsProfile.cardID as CARDID,
dbo.tblCardsProfile.cardName AS CARDNAME,
dbo.tblSalesInvoice.salesInvoiceNo AS INVOICENO,
convert(varchar, dbo.tblSalesInvoice.transDate, 101) AS [DATE],
dbo.tblSalesInvoice.totalAmount AS TOTALAMOUNT,
0 AMOUNTPAID
FROM
dbo.tblCardsProfile
INNER JOIN dbo.tblSalesInvoice ON dbo.tblCardsProfile.cardID = dbo.tblSalesInvoice.cardID
GROUP BY
dbo.tblCardsProfile.cardID,
dbo.tblCardsProfile.cardName,
dbo.tblSalesInvoice.salesInvoiceNo,
dbo.tblSalesInvoice.transDate,
dbo.tblSalesInvoice.totalAmount
UNION ALL
SELECT
dbo.tblCardsProfile.cardID as CARDID,
dbo.tblCardsProfile.cardName AS CARDNAME,
dbo.tblSalesInvoice.salesInvoiceNo AS INVOICENO,
convert(varchar, dbo.tblSalesInvoice.transDate, 101) AS [DATE],
0 AS TOTALAMOUNT,
Sum(dbo.tblPaymentsAmountApplied.amountApplied) AS AMOUNTPAID
FROM
dbo.tblCardsProfile
INNER JOIN dbo.tblSalesInvoice ON dbo.tblCardsProfile.cardID = dbo.tblSalesInvoice.cardID
INNER JOIN dbo.tblPaymentsAmountApplied ON dbo.tblSalesInvoice.salesInvoiceNo = dbo.tblPaymentsAmountApplied.invoiceNo
GROUP BY
dbo.tblCardsProfile.cardID,
dbo.tblCardsProfile.cardName,
dbo.tblSalesInvoice.salesInvoiceNo,
dbo.tblSalesInvoice.transDate,
dbo.tblSalesInvoice.totalAmount
) AS SUBT
GROUP BY
CARDID,CARDNAME,INVOICENO,[DATE]
GO


-- ----------------------------
-- View structure for paymentsView_copy1
-- ----------------------------
IF EXISTS (SELECT * FROM sys.all_objects WHERE object_id = OBJECT_ID(N'[dbo].[paymentsView_copy1]') AND type IN ('V'))
	DROP VIEW [dbo].[paymentsView_copy1]
GO

CREATE VIEW [dbo].[paymentsView_copy1] AS select INVOICENO, CASE WHEN TOTALAMOUNT - AMOUNTPAID = 0 THEN 'CLOSE' ELSE 'OPEN' END as STATUS,[DATE],TOTALAMOUNT,AMOUNTPAID
FROM(SELECT
dbo.tblCardsProfile.cardID as CARDID,
dbo.tblCardsProfile.cardName as Name,
dbo.tblSalesInvoice.salesInvoiceNo as INVOICENO,
dbo.tblSalesInvoice.transDate as [DATE],
dbo.tblSalesInvoice.totalAmount as TOTALAMOUNT,
0 as AMOUNTPAID
FROM
dbo.tblSalesInvoice
INNER JOIN dbo.tblCardsProfile ON dbo.tblCardsProfile.cardID = dbo.tblSalesInvoice.cardID
UNION ALL
SELECT
dbo.tblCardsProfile.cardID as CARDID,
dbo.tblCardsProfile.cardName as Name,
dbo.tblPaymentsAmountApplied.invoiceNo AS INVOICENO,
dbo.tblSalesInvoice.transDate AS [DATE],
dbo.tblSalesInvoice.totalAmount AS TOTALAMOUNT,
dbo.tblPaymentsAmountApplied.amountApplied AS AMOUNTPAID
FROM
dbo.tblPaymentsReceived
INNER JOIN dbo.tblPaymentsAmountApplied ON dbo.tblPaymentsReceived.paymentNo = dbo.tblPaymentsAmountApplied.paymentNo
INNER JOIN dbo.tblSalesInvoice ON dbo.tblSalesInvoice.salesInvoiceNo = dbo.tblPaymentsAmountApplied.invoiceNo
INNER JOIN dbo.tblCardsProfile ON dbo.tblCardsProfile.cardID = dbo.tblPaymentsReceived.cardID) AS SUBT
GO


