CREATE PROCEDURE [dbo].[insert_Purchases]
@processCount int,
@purchaseMode varchar(255),
@purchaseno varchar(255),
@dateofTR date,
@refNo varchar(255),
@cardID varchar(255),
@totalAmount decimal(20,2),
@userid varchar(255),
@itemNo varchar(255),
@qty int,
@uprice decimal(20,2),
@amount decimal(20,2)


AS
BEGIN
begin try
if  @purchaseMode = 'PURCHASE REQUISITION' and @processCount = 0 BEGIN
INSERT INTO tblPurchaseRequisition values(@purchaseno,@refNo,@dateofTR,@cardID,@totalAmount,@userid)
end
else IF @purchaseMode = 'PURCHASE ORDER' BEGIN
INSERT INTO tblPurchaseOrder values(@purchaseno,@dateofTR,@refNo,@cardID,@totalAmount,@userid)
END
else IF @purchaseMode = 'PURCHASE INVOICE' BEGIN
INSERT INTO tblPurchaseInvoice values(@purchaseno,@dateofTR,@refNo,@cardID,@totalAmount,@userid)
END
end try
begin catch
end catch
begin try
if  @purchaseMode = 'PURCHASE REQUISITION' BEGIN
INSERT INTO tblPurchaseRequisitionTR values(@purchaseno,@itemNo,@qty,@uprice,@amount)
end
else IF @purchaseMode = 'PURCHASE ORDER' BEGIN
INSERT INTO tblPurchaseOrderTR values(@purchaseno,@itemNo,@qty,@uprice,@amount)
END
else IF @purchaseMode = 'PURCHASE INVOICE' BEGIN
INSERT INTO tblPurchaseInvoiceTR values(@purchaseno,@itemNo,@qty,@uprice,@amount)
END
end try
begin catch
end catch
end
GO


