CREATE PROCEDURE [dbo].[insert_SalesAndPayments]
@processCount int,
@salesMode varchar(255),
@salesno varchar(255),
@dateofTR date,
@refNo varchar(255),
@cardID varchar(255),
@totalAmount decimal(20,2),
@userid varchar(255),

@itemNo varchar(255),
@qty int,
@uprice decimal(20,2),
@amount decimal(20,2),

@paymentNo varchar(255),
@paymethod varchar(255),
@checkno varchar(255),
@postdate date,
@paymentReceived decimal(20,2),
@outOFBalance decimal(20,2),
@overAllBalance decimal(20,2),
@depositToAccount VARCHAR(255)
AS
BEGIN
begin try
if  @salesMode = 'QUOTATION' and @processCount = '0' BEGIN
INSERT INTO tblQuotation values(@salesno,@dateofTR,@cardID,@totalAmount,@userid)
end
else IF @salesMode = 'SALES ORDER' BEGIN
INSERT INTO tblSalesOrder values(@salesno,@dateofTR,@refNo,@cardID,@totalAmount,@userid)
END
else IF @salesMode = 'SALES INVOICE' BEGIN
INSERT INTO tblSalesInvoice values(@salesno,@dateofTR,@refNo,@cardID,@totalAmount,@userid)
END
end try
begin catch
end catch
begin try
if  @salesMode = 'QUOTATION' BEGIN
INSERT INTO tblQuotationTR values(@salesno,@itemNo,@qty,@uprice,@amount)
end
else IF @salesMode = 'SALES ORDER' BEGIN
INSERT INTO tblSalesOrderTR values(@salesno,@itemNo,@qty,@uprice,@amount)
END
else IF @salesMode = 'SALES INVOICE' BEGIN
INSERT INTO tblSalesInvoiceTR values(@salesno,@itemNo,@qty,@uprice,@amount)
END
end try
begin catch
end catch
begin try
if @paymethod <> 'CREDIT' and @salesMode = 'SALES INVOICE' and @processCount = '0' BEGIN
INSERT INTO tblPaymentsReceived values(@paymentNo,@dateofTR,@cardID,@paymethod,@checkno,@postdate,@paymentReceived,@outOFBalance,
@overAllBalance,@depositToAccount,@userid)
end
end try
begin catch
end catch
begin try
if @paymethod <> 'CREDIT' and @salesMode = 'SALES INVOICE' and @processCount = '0' BEGIN
INSERT INTO tblPaymentsAmountApplied values(@paymentNo,@salesno,@paymentReceived)
end
end try
begin catch
end catch
end
GO


