	DROP PROCEDURE[dbo].[insert_update_checkVoucher]
GO

CREATE PROCEDURE [dbo].[insert_update_checkVoucher]
@command as int,
@transNo as varchar(255),
@refno as varchar(255),
@transdate as datetime2,
@tinNo as varchar(255),
@payee as varchar(255),
@address as varchar(255),
@bankID as varchar(255),
@checkNo as varchar(255),
@totalAmount as decimal(20,2),
@totalDebit as decimal(20,2),
@totalCredit as decimal(20,2),
@amountInwords as varchar(255),
@userid as varchar(255),
@status as varchar(255)

AS
BEGIN
if @command = 0 begin
insert into tblCheckVoucher values(@transno,@refno,@transdate,@tinNo,@payee,@address,@bankID,@checkNo,@totalAmount,@totalDebit,@totalCredit,@amountinWords,@userid,@status,0,GETDATE())
end
else if @command = 1 begin
update tblCheckVoucher set date_transaction = @transdate,tinNo = @tinNo,payee = @payee,address = @address, bankID = @bankid,checkno = @checkNo,totalAmount = @totalAmount,totalDebit = @totalDebit,totalCredit = @totalcredit,amountInwords = @amountInWords,userId = @userid,status = @status,notimesedit += 1,lastdateedit = getdate()
end
END
GO


